import React from "react";

const MarsFormII = props => {
  return (
    <div>
      <form>
        <label htmlFor="breath">
          {" "}
          Can you breathe underwater longer than 1 minute?{" "}
        </label>
        <input type="radio" id="breath" name="gender" value="breath" />
      </form>
    </div>
  );
};

export default MarsFormII;
